db.patients.aggregate([
    { $lookup: {
        from: "organizations",
        localField: "ENCOUNTERS.ORGANIZATION_REF",
        foreignField: "ORGANIZATION_ID",
        as: "organization"
    }},
    { $unwind: "$ENCOUNTERS" },
    { $unwind: "$organization" },
    { $match: { "organization.ORGANIZATION_ID": "a194e94a-dd16-347e-95ea-8d00052c14d1" } },
    { $project: { _id: 0, encounter_description: "$ENCOUNTERS.DESCRIPTION" } }
])

db.patients.aggregate([
    { $lookup: {
        from: "organizations",
        localField: "ENCOUNTERS.ORGANIZATION_REF",
        foreignField: "ORGANIZATION_ID",
        as: "organization"
    }},
    { $unwind: "$ENCOUNTERS" },
    { $unwind: "$organization" },
    { $match: { "organization.NAME": "HOSPICE SERVICES OF WESTERN & CENTRAL MASS" } },
    { $project: { _id: 0, encounter_description: "$ENCOUNTERS.DESCRIPTION" } }
])

db.patients.aggregate([
    { $lookup: {
        from: "payers",
        localField: "PAYER_TRANSITIONS.PAYER_REF",
        foreignField: "PAYER_ID",
        as: "payer_details"
    } },
    { $unwind: "$PAYER_TRANSITIONS" },
    { $unwind: "$payer_details" },
    { $match: { "payer_details.PAYER_ID": "e03e23c9-4df1-3eb6-a62d-f70f02301496" } },
    { $count: "encounters_covered" }
]);

db.patients.aggregate([
    {
        $lookup: {
            from: "payers",
            localField: "PAYER_TRANSITIONS.PAYER_REF",
            foreignField: "PAYER_ID",
            as: "payer_details"
        }
    },
    { $unwind: "$PAYER_TRANSITIONS" },
    { $unwind: "$payer_details" },
    { $match: { "payer_details.PAYER_ID": "8fa6c185-e44e-3e34-8bd8-39be8694f4ce" } },
    { $project: { _id: 0, first: "$FIRST", last: "$LAST" } },
    { $group: { _id: { first: "$first", last: "$last" } },
    { $project: { _id: 0, first: "$_id.first", last: "$_id.last" } }
]);

